import React from 'react';
import Hero from '../components/Hero';
import Picture from '../components/Picture';
import Content from '../components/Content';
function AboutPage(props){
return(

  <div>

          <Hero title={props.title} />
          <Picture />
          <Content>
          <p></p>
          <p>Hey Beautiful People! My name is Saigopini Panneerselvam, but I go by Sai (pronounced like "sigh"). I grew up in the Bay Area and when to college around there, double-majoring in math and computer science. It was hard being one of the only women in most of my classes but regardless,
          I kept my head up and discovered my passion for STEM during a hackathon held at my university. We created a platform that connects homeless shelters to restaurants in order feed hungry bellies in a sustainable way by cutting down food waste. It was then when I realized the instant gratification that comes from computer science and the power of technology to help our fellow human beings.
          I never had any experience in frontend development but in those 24 hours, I was able to contribute to something beautiful.
          I started working at a healthcare company with a mission that I'm incredibly passionate about straight out of graduation and stumbled into the field of data science. </p>
          <p>I try to live everyday with a growth mindset: taking everything that life throws my way as a learning opportunity which has helped me be more resilient and positive. I want to help empower other women to purse careers in STEM so that they don't face the sexism and challenges I and so many others had to endure. In my spare time, I mentor high school girls in coding and I hope to share on this platform what I've learned. In my free time, I love to hang out with my dog, Merlin (he's a Border Collie lab mix we adopted), solo travel, write (currently working on a secret project!), and volunteer. I'm excited to hear from you all :)  </p>
          </Content>
      </div>

);
}
export default AboutPage;
